import React, { Component } from "react";
import Grid from '@material-ui/core/Grid';
import { Button, FormControl } from '@material-ui/core';
import './styles.css';

export class FormUserDetails extends Component {

    continue = e => {
        e.preventDefault();
        this.props.nextStep();
    };

    back = e => {
        e.preventDefault();
        this.props.prevStep();
    };

    render() {
        const {
            values: { username, email, password, location, team }
        } = this.props;
        return (

            <React.Fragment>
                <form>
                    <div className="container bm-padding align-self-center">


                        <div className="container-fluid align-content-center">
                            <FormControl>
                                <h1>Confirm</h1>

                                <ul className="container">
                                    <li primaryText="Username" secondaryText={username} />
                                    <li primaryText="Email" secondaryText={email} />
                                    <li primaryText="Password" secondaryText={password} />
                                    <li primaryText="Location" secondaryText={location} />
                                    <li primaryText="Team" secondaryText={team} />
                                </ul>

                                <Grid className="">
                                    <Button type="submit" variant="extendedFab" className="btn-success" onClick={this.continue}>
                                        confirm and continue
								</Button>

                                    <Button type="submit" variant="extendedFab" className="btn-success" onClick={this.back}>
                                        back
								</Button>
                                </Grid>
                            </FormControl>
                        </div>
                    </div>


                </form>
            </React.Fragment>

        );
    }
}



export default FormUserDetails;
